Analyze the following code and explain what it does:

def func(n):
    if n == 0:
        return 0
    else:
        return n + func(n - 1)

Rewrite this program to use an embedded loop instead of recursion:

def fibonacci(num):
    if num == 0:
        return 0
    elif num == 1:
        return 1
    else:
        return fibonacci(num-1) + fibonacci(num-2)

What is the Big O notation of the algorithm below?

def myfunc(n):
  total = 0
  for i in range(n):
    for j in range(n):
      total += 1
  return total
